import Head from 'next/head';
import 'bootstrap/dist/css/bootstrap.min.css';

import './styles/main.css'
export default () => (
  <div>
    <Head>
      <title>My styled page</title>
    </Head>
    <p className="text-warning">Hello World</p>
    <Link href='/about'>
      <a>About</a>
    </Link>
  </div>
)
